function Task({task}) {
    console.log({task});
    return(
        <>
        <h5>{task.taskname}</h5><br></br>
        {task.completion && <h5 className='completed'>Completed</h5>}
        {!(task.completion) && <h5 className='notcompleted'>Not complete</h5>}
        </>
    );
}

export default Task;
